import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './css/App.css';
import NavBar from './components/NavBar';
import Home from './components/home';


function App() {
  return (
    <BrowserRouter>
    <div className="App container">
      <Switch>
        <Route exact path="/">
      <NavBar></NavBar>
      </Route>
      </Switch>
      <div>
      <img src="/images/bg.png" b className='bg' alt="fg"/>
      </div>
    </div>
    </BrowserRouter>
  );
}

export default App;
